import * as Types from '../constants/ActionTypes'

const initialState = [];
const orderReducer = (state = initialState, action) => {
    let type = action.type;
    let payload = action.payload;

    switch (type) {
        case Types.GET_ORDERS:
            return [...action.data];
        default:
            return state;
    }
}

export default orderReducer
